import React, { useEffect } from "react";
import Fieldset from "part:@sanity/components/fieldsets/default";
import PatchEvent, { set, unset } from "part:@sanity/form-builder/patch-event";
import Commerce from "@chec/commerce.js";

const commerce = new Commerce(
  "pk_184625ed86f36703d7d233bcf6d519a4f9398f20048ec",
  true
);

const createPatchFrom = (value) =>
  PatchEvent.from(value === "" ? unset() : set(value));

const CommercejsProducts = ({ type, value, markers, level, onChange }) => {
  useEffect(() => {
    commerce.products
      .list()
      .then((res) => {
        console.log([{ id: res.data[0].id }, { id: res.data[1].id }]);
        onChange(createPatchFrom([res.data[0], res.data[1]]));
      })
      .catch((error) => {
        console.log("There was an error fetching the products", error);
      });
  }, []);
  const { title, description } = type;
  return (
    <Fieldset
      legend={title}
      description={description}
      markers={markers}
      level={level}
    >
      {JSON.stringify(value)}
    </Fieldset>
  );
};

export default CommercejsProducts;

